var script_loaded=false;function loadJSscripts(){if(script_loaded)return;else{script_loaded=true;var static_script=document.getElementsByTagName("script");for(i=0;i<static_script.length;i++){if(static_script[i].getAttribute("data-src")!==null){var element=document.createElement("script");element.src=static_script[i].getAttribute("data-src");document.body.appendChild(element);}}if(typeof resize_chat!=="undefined")resize_chat();document.dispatchEvent(new CustomEvent('StartKernelLoading'));document.dispatchEvent(new CustomEvent('StartAsyncLoading'));setTimeout(function(){let lazyVideos=[...document.querySelectorAll(".lazy-video")];lazyVideos.forEach(video=>{video.src=video.dataset.src;if(/mobile/i.test(navigator.userAgent))video.play();else video.load();})},300);}}window.addEventListener("scroll",function(event){loadJSscripts();});window.addEventListener("mousemove",function(){loadJSscripts();});window.addEventListener("touchstart",function(){loadJSscripts();});if(window.addEventListener)window.addEventListener("load",function(){setTimeout(loadJSscripts,5e3)},false);else if(window.attachEvent)window.attachEvent("onload",function(){setTimeout(loadJSscripts,5e3)});else window.onload=loadJSscripts;